    expect(outputData[0].gene).toEqual(['JUNB', 'CXCL2', 'ATF3', 'NFKBIA', 'TNFAIP3', 'PTGS2', 'CXCL1', 'IER3', 'CD83', 'CCL20', 'CXCL3', 'MAFF', 'NFKB2', 'TNFAIP2', 'HBEGF', 'KLF6', 'BIRC3', 'PLAUR', 'ZFP36', 'ICAM1', 'JUN', 'EGR3', 'IL1B', 'BCL2A1', 'PPP1R15A', 'ZC3H12A', 'SOD2', 'NR4A2', 'IL1A', 'RELB', 'TRAF1', 'BTG2', 'DUSP1', 'MAP3K8', 'ETS2', 'F3', 'SDC4', 'EGR1', 'IL6', 'TNF', 'KDM6B', 'NFKB1', 'LIF', 'PTX3', 'FOSL1', 'NR4A1', 'JAG1', 'CCL4', 'GCH1', 'CCL2', 'RCAN1', 'DUSP2', 'EHD1', 'IER2', 'REL', 'CFLAR', 'RIPK2', 'NFKBIE', 'NR4A3', 'PHLDA1', 'IER5', 'TNFSF9', 'GEM', 'GADD45A', 'CXCL10', 'PLK2', 'BHLHE40', 'EGR2', 'SOCS3', 'SLC2A6', 'PTGER4', 'DUSP5', 'SERPINB2', 'NFIL3', 'SERPINE1', 'TRIB1', 'TIPARP', 'RELA', 'BIRC2', 'CXCL6', 'LITAF', 'TNFAIP6', 'CD44', 'INHBA', 'PLAU', 'MYC', 'TNFRSF9', 'SGK1', 'TNIP1', 'NAMPT', 'FOSL2', 'PNRC1', 'ID2', 'CD69', 'IL7R', 'EFNA1', 'PHLDA2', 'PFKFB3', 'CCL5', 'YRDC', 'IFNGR2', 'SQSTM1', 'BTG3', 'GADD45B', 'KYNU', 'G0S2', 'BTG1', 'MCL1', 'VEGFA', 'MAP2K3', 'CDKN1A', 'CCN1', 'TANK', 'IFIT2', 'IL18', 'TUBB2A', 'IRF1', 'FOS', 'OLR1', 'RHOB', 'AREG', 'NINJ1', 'ZBTB10', 'PLPP3', 'KLF4', 'CXCL11', 'SAT1', 'CSF1', 'GPR183', 'PMEPA1', 'PTPRE', 'TLR2', 'ACKR3', 'KLF10', 'MARCKS', 'LAMB3', 'CEBPB', 'TRIP10', 'F2RL1', 'KLF9', 'LDLR', 'TGIF1', 'RNF19B', 'DRAM1', 'B4GALT1', 'DNAJB4', 'CSF2', 'PDE4B', 'SNN', 'PLEK', 'STAT5A', 'DENND5A', 'CCND1', 'DDX58', 'SPHK1', 'CD80', 'TNFAIP8', 'CCNL1', 'FUT4', 'CCRL2', 'SPSB1', 'TSC22D1', 'B4GALT5', 'SIK1', 'CLCF1', 'NFE2L2', 'FOSB', 'PER1', 'NFAT5', 'ATP2B1', 'IL12B', 'IL6ST', 'SLC16A6', 'ABCA1', 'HES1', 'BCL6', 'IRS2', 'SLC2A3', 'CEBPD', 'IL23A', 'SMAD3', 'TAP1', 'MSC', 'IFIH1', 'IL15RA', 'TNIP2', 'BCL3', 'PANX1', 'FJX1', 'EDN1', 'EIF1', 'BMP2', 'DUSP4', 'PDLIM5', 'ICOSLG', 'GFPT2', 'KLF2', 'TNC', 'SERPINB8', 'MXD1'])
